import React from 'react';
import './Transaction.css';

import Accordion from '@material-ui/core/Accordion';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

export enum TransactionType {
  CREDIT = 'credit',
  DEBIT = 'debit'
}

export interface TransactionProps {
  id: string;
  type: TransactionType;
  amount: number;
  effectiveDate: string;
}

export const Transaction: React.FC<TransactionProps> = ({id, type, amount, effectiveDate}) => {
  return (
    <Accordion>
      <AccordionSummary className="transaction-header" expandIcon={<ExpandMoreIcon />}>
        <p className={`transaction-${type}`}><span>Transaction:</span> {amount} ({type})</p>
      </AccordionSummary>
      <AccordionDetails className="transaction-body" >
        <p><span>Type:</span> {type}</p>
        <p><span>Amount:</span> {amount}</p>
        <p><span>Date:</span> {effectiveDate}</p>
        <p><span>Id:</span> {id}</p>
      </AccordionDetails>
    </Accordion>
  );
}
